INSERT INTO `faq` (`id`, `question`, `answer`, `position`) VALUES
(1, 'Can I download resume?', '&lt;p&gt;Yes, you can download your resume if you are a candidate. After login you will have that option &quot;Download Resume&quot;, a pdf file of your resume will be downloaded.&lt;/p&gt;&lt;p&gt;Employers can also download resume when you apply to a job.&lt;/p&gt;', 2),
(2, 'How the subscription works?', '&lt;p&gt;You can create as many as subscription packages with job post and duration limit.&lt;/p&gt;&lt;p&gt;You can create one time or recurring subscription packages.&lt;/p&gt;', 1),
(3, 'Any cost for creating resume here?', '&lt;p&gt;No, it is absolutely free to create resume and apply to job here.&lt;/p&gt;', 4),
(4, 'How can I pay for subscription?', '&lt;p&gt;There&#039;s a lots of payment gateways&amp;nbsp;like:&amp;nbsp;Authorize Net,&amp;nbsp;PayPal,&amp;nbsp;Payza,&amp;nbsp;Skrill and&amp;nbsp;Stripe.&lt;/p&gt;&lt;p&gt;You can make it with anyone of these.&lt;/p&gt;', 3),
